    <>
      <Card borderRadius={0} >
        <Text p={4} textAlign={"center"} fontSize={"2xl"} fontWeight={'500'} color={"#27374D"}>
          T-MACHINE SOFTWARE SOLUTION PVT.LTD
        </Text>
      </Card>
    </>
  );
}
